import {
  Container,
  Navbar,
  Nav,
  NavItem
} from 'react-bootstrap';

import logo from 'logo.svg';


function Header(){
  return(
    <Navbar>
      <Container>
        <Navbar>
          <Navbar>
            <a href="#">
              <img
                src={logo}
                alt="Logo"
              />
            </a>
          </Navbar>
        </Navbar>
        <Nav>
          <NavItem href="#">Link</NavItem>
        </Nav>
      </Container>
    </Navbar>
  )
}

export default Header;
